import React from 'react';
import java from './images/java.png';
import html from './images/html.png';
import css from './images/css.png';
import jquery from './images/jquery.png';
import react from './images/react.png';
import './index.css'

export default function Languages() {


    return (
        <div className='languages-container'>
            <h1>Languages</h1>
            <img src={html} className='images' style={{
                height: '250px',
                width: '200px',
                padding: '20px'
            }} />
            <img src={css} className='images' style={{
                height: '250px',
                width: '200px',
                padding: '20px'
            }}/>
            <img src={java} className='images' style={{
                height: '250px',
                width: '200px',
                padding: '20px'
            }}/>
            <img src={jquery} className='images' style={{
                height: '100px',
                width: '400px',
                padding: '20px'
            }}/>
            <img src={react} className='images' style={{
                height: '120px',
                width: '320px',
                padding: '20px'
            }}/>

        </div>
    )
}
